import React from 'react';
import style from './Post.module.css';
function Post(props) {
  const posts = {
    imageGroup: 'https://memax.club/wp-content/uploads/2019/05/55-176.jpg',
    groupName: 'Group Name',
  };
  return (
    <div className={style.main}>
      <div className={style.group_name}>
        <img className={style.image_group} src={posts.imageGroup} alt="group image" />
        <div className={style.group_description}>
          <div>{posts.groupName}</div>
          <div>Data Post</div>
        </div>
      </div>
      <div>
        <div className={style.post_description}>Description</div>
        <img
          className={style.post_image}
          src="http://www.cruzo.net/user/images/k/ecc3ecf42c75db1ffce5d06cbe95b1e6_644.jpg"
          alt="post image"
        />
      </div>
      <div className={style.group_like}>
        <div className={style.like}>Like 12</div>
        <div className={style.like}>Comments 15</div>
        <div>Reposts 8</div>
      </div>
    </div>
  );
}

export default Post;
